graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>Fail Fast</b></font></td></tr><tr><td align="center"><font point-size="10">v @errorHandling(&quot;fail-fast&quot;)</font></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="logLevel__key" align="left" balign="left">logLevel</td><td port="logLevel__value" align="left" balign="left">debug</td></tr></table></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "Path1" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Path1</b> <i>&lt;init&gt;</i></td></tr><tr><td align="left">First workflow</td></tr></table>>, shape=ellipse, fillcolor="#FFF3E0", style=filled, color="#F57C00"];
  "Path2" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Path2</b> <i>&lt;init&gt;</i></td></tr><tr><td align="left">Second workflow</td></tr></table>>, shape=ellipse, fillcolor="#FFF3E0", style=filled, color="#F57C00"];
  "Task1A" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Task1A</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Task 1A</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "Task1B" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Task1B</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Task 1B</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "Task2A" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Task2A</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Task 2A</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "Task2B" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Task2B</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Task 2B</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];

  // Edges
  "Path1" -> "Task1A" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "Task1A" -> "Task1B" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "Path2" -> "Task2A" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "Task2A" -> "Task2B" [labelOverlay="75%", labelhref="#srcLineTBD"];
}
